INSERT INTO `support_tickets` VALUES (1,1,1,1,'<p>App first ticket</p>',NULL,NULL,'2023-05-23 23:29:08',NULL,'WORK-000001',NULL,1,'2023-05-23 17:00:33','2023-05-22 23:29:08','2023-05-23 17:00:33'),(2,2,7,4,'<p>Computer located in fifth floor with cubicle # 5h-03 has internet open. Please verify. Thanks.</p>',6,'2023-05-23 13:46:22','2023-05-24 13:02:33','2023-05-23 14:57:08','ITSU-000001',NULL,5,NULL,'2023-05-23 13:02:33','2023-05-23 14:57:08'),(3,7,7,5,'<p>The Campaign Hotel Planner Needs to move to the 4th floor. Today in the afternoon.&nbsp;</p>',10,'2023-05-23 16:05:54','2023-05-23 14:55:48','2023-05-29 22:20:48','ITSU-000002',NULL,6,NULL,'2023-05-23 14:25:48','2023-05-29 22:20:48'),(4,2,7,5,'<p>Internet lagging and speed too Slow and some packages are timed out (lost)… Please verify&nbsp;</p>',10,'2023-05-23 16:05:40','2023-05-23 16:13:11','2023-05-29 22:21:09','ITSU-000003','tickets/4.jpg',6,NULL,'2023-05-23 15:43:11','2023-05-29 22:21:09'),(5,9,7,6,'<p>we need the training room set up (Ecco u) for a training of 9 agents plus one trainer so 10 computers fully equipped like the ones on the floor. this training is set to start on May 30th</p><p>2 monitor</p><p>cpu with ssd disk</p><p>camera</p><p>english keyboard</p><p>mouse</p><p>headset</p><p>thanks,</p><p>Luis M. C. Medina</p><p>&nbsp;</p>',6,'2023-05-23 16:05:25','2023-05-25 15:47:29','2023-05-30 14:28:19','ITSU-000004',NULL,6,NULL,'2023-05-23 15:47:29','2023-05-30 14:28:19'),(6,9,7,6,'<p>need the add on of grammarly on all computers in the EFI floor to be added to the edge browser.</p><p>&nbsp;</p><p>thanks,</p><p>Luis M. C. Medina</p><p>&nbsp;</p>',6,'2023-05-23 18:25:05','2023-05-25 16:26:56','2023-05-24 19:34:31','ITSU-000005',NULL,5,NULL,'2023-05-23 16:26:56','2023-05-24 19:34:31'),(7,9,7,6,'<p>please update all headsets on the efi floor from plantronic to logitech.</p><p>&nbsp;</p><p>thanks,</p><p>Luis M. C. Medina</p>',6,'2023-05-23 18:25:14','2023-05-25 16:38:57','2023-05-24 19:30:51','ITSU-000006',N