20:57:35'),(210,31,7,28,'<p>One of the Pc\'s is not working properly everyday around this time it is very slow</p>',30,'2023-07-14 12:00:51','2023-07-13 23:38:42','2023-07-14 12:02:34','ITSU-000189',NULL,6,NULL,'2023-07-13 19:38:42','2023-07-14 12:02:34'),(211,15,7,28,'<p>Los siguiente agentes &nbsp;necesitan logear five9 en dynami, 1E:10 Santiana, 1E:12 Yenca, 1F:01 Ramon, 1F:08 Jose, 1F:12 Kerline, 1F:11 Thalie, 1F:07 Daniel, 1F:02 Ronaldo, 1E:07 Rony, 1F:04 Marcky.</p>',30,'2023-07-13 21:35:39','2023-07-14 01:28:58','2023-07-13 21:36:32','ITSU-000190',NULL,5,NULL,'2023-07-13 21:28:58','2023-07-13 21:36:32'),(212,13,7,4,'<p>Headset de estación 1D:05 tienen el cable un poco deteriorado</p>',6,'2023-07-14 12:26:08','2023-07-17 12:26:08','2023-07-14 12:29:49','ITSU-000191',NULL,5,NULL,'2023-07-14 12:26:08','2023-07-14 12:29:49'),(213,18,7,4,'<p>Please change the keyboards for stations 2C:03 and 2A:12</p>',30,'2023-07-14 12:32:09','2023-07-17 12:30:38','2023-07-14 13:27:56','ITSU-000192',NULL,5,NULL,'2023-07-14 12:30:38','2023-07-14 13:27:56'),(214,31,7,28,'<p>Need to be advised on how dialer works also need to verify that the headsets being used are noise cancelling and we need call back phone number. Alain is no longer with the team so I\'m going to need everything of his changed to Jerson Joseph please.</p><p>Thank you!</p>',10,'2023-07-14 16:00:22','2023-07-14 17:28:15','2023-07-14 16:00:36','ITSU-000193',NULL,5,NULL,'2023-07-14 13:28:15','2023-07-14 16:00:36'),(215,2,7,28,'<p>Hey Guys,</p><p>Some PCs are hibernating, disconnecting the system agents (RC), because the Domain does not allow us to turn off this option, would there be any way that you (IT) can do it via domain? Or would you have to do it manually?</p><p>waiting for your prompt reply and help.<br>Thank you.</p>',30,'2023-07-14 15:46:17','2023-07-14 19:45:10','2023-07-14 15:54:29','ITSU-000194',NULL,5,NULL,'2023-07-14 15:45:10','2023-07-14 15:54:29'),(216,10,1,29,'<p>Hola Yismen,</p><p>&nbsp;</p><p>Como te comentaba para hay unas cuantas cosas que creo que seria bueno ajustar en el sistema de tickets con lo relacionado al departamento de tecnología.</p><p>&nbsp;</p><p>Por ejemplo :</p><p>&nbsp;</p><p>Las Categorias (Subject): Son muy especificas y limitadas. Por lo que están poniendo categorías erróneas y por lo tanto tiempos de responder ese ticket que no corresponde al nivel de prioridad que amerita la situación. Sugiero las siguientes categorías o subjects:</p><p>&nbsp;</p><ul><li>Llave de acceso: Todo lo relacionado con los accesos.</li><li>Mover equipo: Todo lo que implique movilizar algún dispositivo.</li><li>Reparar o reemplazar: Todo lo referente a un equipo que no este trabajando adecuadamente o solicitud de uno nuevo.</li><li>Problemas de usuario: Se usaría en caso de que necesite algún tipo de credencial.</li><li>Problemas de internet: Todo lo referente a nuestra red interna o wifi.</li></ul><p>Nivel de prioridad: El tiempo que se les asigna a estas categorías deberían estar configurados segun el tiempo que TI sugiera, ya que sabemos el tiempo aproximado que toma cada una de estas.</p><p>&nbsp;</p><ul><li>Llave de acceso: No es de alta prioridad por lo que se le puede asignar un tiempo de 3 a 4 días.</li><li>Mover equipo: Dependiendo la cantidad de los mismos podría tomar 3 días.</li><li>Reparar o reemplazar: En esta parte depende si tenemos el equipo a reemplazar en existencia o no pero asumiendo que si este podríamos darle 2 a 3 horas.</li><li>Problemas de usuarios: Podríamos asignar de 3 a 4 horas según la cantidad de usuarios.</li><li>Problemas de internet: Entiendo que esta es la mas critica por lo que podemos darle de 1 a 2 horas.</li></ul><p>&nbsp;</p><p>Otro inconveniente es el asunto de asignar los tickets la misma persona que los crea, lo mas eficiente seria que llegue al departamento y nosotros asignar las tareas.</p><p>&nbsp;</p><p>Favor déjame saber si es posible o no, cualquier duda quedo a la orden.</p>',11,'2023-07-14 15:59:45','2023-07-